    <React.Fragment>

        <Grid  xs={12} >
             <Typography className="navigation" style={{fontFamily:"monospace",textAlign:"center",fontSize:"54px",paddingTop:"44px"}}>
                 Customer Relationship Management
             </Typography>
             
         </Grid>
       
          
    </React.Fragment>
  )
}

